						//	if (Math.abs(rect.x - rect2.x) < (rect.width / 2 + rect2.getTransformedBounds().width / 2) && Math.abs(rect.y - rect2.y) < (rect.height / 2 + rect2.getTransformedBounds().height / 2)) {
